                </section>
                <section>
                <section>
                <img src='' className='insta' alt='insta'/>
                </section>
                <section>
                <img src='https://seeklogo.com/images/L/linkedin-black-icon-logo-ECC426C572-seeklogo.com.png' className='linkedin' alt='linkedin'/>
                </section>
                <section>
                <img src='' className='github' alt='github'/>
                </section>
                </section>
          </section>
        )
    }
}

export default Header;
